import React from 'react';
import Draggable from 'react-draggable';
import './App.css';

const Siatka = () => {
  const grid = [];

  for (let i = 0; i < 10; i++) {
    for (let j = 0; j < 10; j++) {
      const key = `${i}-${j}`;
      grid.push(
        <div 
          key={key}
          style={{
            width: '50px',
            height: '50px',
            border: '1px solid black',
            backgroundColor: '#eee',
          }}
        ></div>
      );
    }
  }

  const draggableDivs = [];

  for (let i = 0; i < 5; i++) {
    draggableDivs.push(
      <Draggable 
        key={`draggable-${i}`}
        defaultPosition={{x: 520, y: i * 60}}
        position={null}
        scale={1}
      >
        <div
          style={{
            position: 'fixed',
            width: '50px',
            height: '50px',
            backgroundColor: 'green'
          }}
        />
      </Draggable>
    );
  }

  return (
    <div className="grid">
      {grid}
      {draggableDivs}
    </div>
  );
};

export default Siatka;
